from collections import defaultdict
from typing import List

'''
解题思路：
只要能确定左上角和右下角，矩形就能够被确定。沿着这个思路，可以通过构建sum_matrix，然后暴力遍历所有矩形来求解
1. 构造出一个sum_matrix，sum_matrix[i][j]是以(0, 0)为左上角，(i, h)为右下角的矩形
    通过画图可得知:
    sum_matrix[i][j] = matrix[i][j] + sum_matrix[i - 1][j] + sum_matrix[i][j - 1] - sum[i - 1][j - 1]
2. 遍历sum_matrix，用4个for loop来暴力遍历所有的左上角和右下角
可以方法是work的，但是lc有些test cases会超时

要解决超时的话，需要运用到LC560的思想(在array中求有多少种subarray sum == target)，把这两个串起来就有点难想了
1. 还是先弄出sum_matrix
2. 两个for loop来确定上下row的边界，然后通过第三个loop来确定col的边界
3. 在确定了上下row的边界和col的边界之后，那么就是在这个区间内找有多少个连续的block which sum is the target
'''


def numSubmatrixsum_matrixTarget(matrix: List[List[int]], target: int) -> int:
    res, sum_matrix = 0, build_sum_matrix(matrix)

    # return brute_force(matrix, sum_matrix, target)
    return prefix_sum(matrix, sum_matrix, target)


def brute_force(matrix, sum_matrix, target):
    res = 0
    for i in range(len(matrix)):
        for j in range(len(matrix[i])):
            for o in range(i, len(matrix)):
                for p in range(j, len(matrix[o])):
                    # [i, j]是左上角点，[o, p]是右下角点。通过这两个点可以确定一个矩形
                    upper_sum = 0 if i == 0 else sum_matrix[i - 1][p]
                    left_sum = 0 if j == 0 else sum_matrix[o][j - 1]
                    upper_left_corner = 0 if i == 0 or j == 0 else sum_matrix[i - 1][j - 1]
                    cur_sum = sum_matrix[o][p] - upper_sum - left_sum + upper_left_corner
                    if cur_sum == target:
                        res += 1
    return res


def prefix_sum(matrix, sum_matrix, target):
    row, col, res = len(matrix), len(matrix[0]), 0

    for i in range(row):
        for j in range(i, row):
            prefix_sum_map = defaultdict(int)
            prefix_sum_map[0] = 1
            for k in range(col):
                upper_sum = 0 if i == 0 else sum_matrix[i - 1][k]
                cur_sum = sum_matrix[j][k] - upper_sum
                res += prefix_sum_map[cur_sum - target]
                prefix_sum_map[cur_sum] += 1

    return res


def build_sum_matrix(matrix):
    sum_matrix = [[0] * len(matrix[0]) for _ in range(len(matrix))]
    for i in range(len(matrix)):
        for j in range(len(matrix[i])):
            if i == 0:
                prev = 0 if j == 0 else sum_matrix[i][j - 1]
                sum_matrix[i][j] = prev + matrix[i][j]
            elif j == 0:
                prev = sum_matrix[i - 1][j]
                sum_matrix[i][j] = prev + matrix[i][j]
            else:
                sum_matrix[i][j] = matrix[i][j] + sum_matrix[i - 1][j] + sum_matrix[i][j - 1] - sum_matrix[i - 1][j - 1]
    return sum_matrix


